import React from "react";
import '../styles.css';
import { useState, useEffect } from "react";

export default function MovieGrid(){
    const [movies, setMovies] = useState([]);
    useEffect(() => {
        fetch("movies.json")
        .then(response => response.json())
        .then(data => setMovies(data));
    },[])

    return(
        <div className="movies-grid">
            {movies.length}
        </div>
    )
}
